import React from 'react';
 
import Footer from '..fragments/Footer';
import "..css/Home"
 
const Home = () => {
 
		return(
 
            <div className="container-home">
 			<main role="main" className="flex-shrink-0 mt-5">
 		            <div className="container">
 		            </div>
 	  		</main>
              <Footer />
            </div>
          
 
		)
 
	}
 
 
export default Home;
